result:
metadata:
  id: "httpPost"
  inputs:
    url: string
    body: any
  outputs:
    response: any
  completion: explicit
  reactiveInputs: []

function httpPost(context: AdvancedContext) {
  const { url, body } = context.inputs;

  return fetch(url, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(body),
  })
    .then(response => response.json())
    .then(data => {
      context.outputs.response = data;
    });
}
